import React, { useState, useEffect } from 'react';



const KnowledgeBase = () => {
    const [knowledgeBase, setKnowledgeBase] = useState([]);



   useEffect(() => {
        fetch('http://localhost:8082/knowledgeBase')
            .then((response) => response.json())
            .then((data) => {
                console.log(data);
                setKnowledgeBase(data);
            })
            .catch((err) => {
                console.log(err.message);
            });
    }, []);



   return (
        <div className="posts-container">
            <table class="table table-striped table-bordered table-sm">
                <thead>
                    <tr>
                        <th scope="col">knowledge_id</th>
                        <th scope="col">knowledge_id</th>
                        <th scope="col">knowledge_number</th>
                        <th scope="col">build_number</th>
                        <th scope="col">file_version</th>
                        <th scope="col">release_data</th>
                        <th scope="col">kb_url</th>
                        <th scope="col">kb_details</th>
                        
                        
                    </tr>
                </thead>
                <tbody>



                   {product.map((product) => {
                        return (



                           <tr>
                                <td>{knowledgeBase.knowledge_id}</td>
                                <td>{knowledgeBase.knowledge_id}</td>
                                <td>{knowledgeBase.knowledge_number}</td>
                                <td>{knowledgeBase.build_number}</td>
                                <td>{knowledgeBase.file_version}</td>
                                <td>{knowledgeBase.release_data}</td>
              					<td>{knowledgeBase.kb_url}</td>
                                <td>{knowledgeBase.kb_details}</td>
                                
                            
                            
                            </tr>
                        );
                    })}
                </tbody>
            </table>
        </div>




    );
};



export default KnowledgeBase;
